package codechef;
import java.util.*;
public class AdaMatrix {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    Scanner sc=new Scanner(System.in);
    int t=sc.nextInt(),count=0;
    while(t-->0) {
    	int n=sc.nextInt();
    	int a[][]=new int[n][n];
    	for(int i=0;i<n;i++) {
        	for(int j=0;j<n;j++) {
        		a[i][j]=sc.nextInt();
        	}
        }
    }
	}

}
